import{_ as a,c as e,o as t,ah as r}from"./chunks/framework.Dtp82s2t.js";const u=JSON.parse('{"title":"gitignore","description":"gitignore 配置","frontmatter":{"title":"gitignore","date":"2025-05-03T00:00:00.000Z","categories":["git"],"tags":["git"],"description":"gitignore 配置"},"headers":[],"relativePath":"posts/git/gitignore.md","filePath":"posts/git/gitignore.md"}'),o={name:"posts/git/gitignore.md"};function l(n,i,g,h,s,d){return t(),e("div",null,i[0]||(i[0]=[r('<h1 id="gitignore" tabindex="-1">gitignore <a class="header-anchor" href="#gitignore" aria-label="Permalink to &quot;gitignore&quot;">​</a></h1><h2 id="配置" tabindex="-1">配置 <a class="header-anchor" href="#配置" aria-label="Permalink to &quot;配置&quot;">​</a></h2><p>在根目录下创建 .gitignore 文件，然后添加需要忽略的文件或文件夹</p><h3 id="应该忽略哪些文件" tabindex="-1">应该忽略哪些文件 <a class="header-anchor" href="#应该忽略哪些文件" aria-label="Permalink to &quot;应该忽略哪些文件&quot;">​</a></h3><ul><li>系统或者软件自动生成的文件</li><li>编译产生的中间文件和结果文件</li><li>运行时生成日志文件、缓存文件、临时文件</li><li>涉及身份、密码、口令、秘钥等敏感信息文件</li></ul><h2 id="配置规则" tabindex="-1">配置规则 <a class="header-anchor" href="#配置规则" aria-label="Permalink to &quot;配置规则&quot;">​</a></h2><p>使用正则匹配 从上到下逐行匹配，每一行表示一个忽略模式</p><h3 id="gitignore-文件的匹配规则" tabindex="-1">gitignore.文件的匹配规则 <a class="header-anchor" href="#gitignore-文件的匹配规则" aria-label="Permalink to &quot;gitignore.文件的匹配规则&quot;">​</a></h3><p>空行或者以#开头的行会被Gt忽略。一般空行用于可读性的分隔，#一般用作注释</p><h3 id="使用标准的glob模式匹配-例如" tabindex="-1">使用标准的Glob模式匹配，例如： <a class="header-anchor" href="#使用标准的glob模式匹配-例如" aria-label="Permalink to &quot;使用标准的Glob模式匹配，例如：&quot;">​</a></h3><ul><li>星号*通配任意个字符</li><li>问号？匹配单个字符</li><li>中括号[]表示匹配列表中的单个字符，比如：[abc]表示ab/c</li><li>两个星号**表示匹配任意的中间目录</li><li>中括号可以使用短中线连接，比如：</li><li>[0-9] 表示任意一位数字，[a-z] 表示任意一位小写字母 感叹号！表示取反</li></ul><h3 id="使用正则表达式匹配" tabindex="-1">使用正则表达式匹配 <a class="header-anchor" href="#使用正则表达式匹配" aria-label="Permalink to &quot;使用正则表达式匹配&quot;">​</a></h3><ul><li><p>#忽略所有的.a文件 *.a</p></li><li><p>#但跟踪所有的lib.a,即便你在前面忽略了.a文件 ！lib.a</p></li><li><p>#只忽略当前目录下的 TODO 文件，而不忽略 subdir/T0D0 /T0D0</p></li><li><p>#忽略任何目录下名为 build的文件夹 build/</p></li><li><p>#忽略 doc/notes.txt, 但不忽略 doc/server/arch.txt doc/*.txt</p></li><li><p>#忽略 doc/目录及其所有子目录下的.pdf文件 doc/**/*.pdf</p></li></ul><h2 id="使用模版" tabindex="-1">使用模版 <a class="header-anchor" href="#使用模版" aria-label="Permalink to &quot;使用模版&quot;">​</a></h2><blockquote><p><a href="https://github.com/github/gitignore" target="_blank" rel="noreferrer">https://github.com/github/gitignore</a></p></blockquote><h3 id="前端使用模版" tabindex="-1">前端使用模版 <a class="header-anchor" href="#前端使用模版" aria-label="Permalink to &quot;前端使用模版&quot;">​</a></h3><blockquote><p><a href="https://raw.githubusercontent.com/github/gitignore/refs/heads/main/Node.gitignore" target="_blank" rel="noreferrer">https://raw.githubusercontent.com/github/gitignore/refs/heads/main/Node.gitignore</a></p></blockquote>',17)]))}const b=a(o,[["render",l]]);export{u as __pageData,b as default};
